Targets:
- AFNetworking:
    Build Phases:
    - SourcesBuildPhase:
      - AFHTTPRequestOperation.m
      - AFHTTPRequestOperationManager.m
      - AFHTTPSessionManager.m
      - AFNetworkActivityIndicatorManager.m
      - AFNetworkReachabilityManager.m
      - AFNetworking-dummy.m
      - AFSecurityPolicy.m
      - AFURLConnectionOperation.m
      - AFURLRequestSerialization.m
      - AFURLResponseSerialization.m
      - AFURLSessionManager.m
      - UIActivityIndicatorView+AFNetworking.m
      - UIAlertView+AFNetworking.m
      - UIButton+AFNetworking.m
      - UIImageView+AFNetworking.m
      - UIProgressView+AFNetworking.m
      - UIRefreshControl+AFNetworking.m
      - UIWebView+AFNetworking.m
    - FrameworksBuildPhase:
      - CoreGraphics.framework
      - Foundation.framework
      - MobileCoreServices.framework
      - Security.framework
      - SystemConfiguration.framework
    - HeadersBuildPhase:
      - AFHTTPRequestOperation.h
      - AFHTTPRequestOperationManager.h
      - AFHTTPSessionManager.h
      - AFNetworkActivityIndicatorManager.h
      - AFNetworkReachabilityManager.h
      - AFNetworking.h
      - AFSecurityPolicy.h
      - AFURLConnectionOperation.h
      - AFURLRequestSerialization.h
      - AFURLResponseSerialization.h
      - AFURLSessionManager.h
      - UIActivityIndicatorView+AFNetworking.h
      - UIAlertView+AFNetworking.h
      - UIButton+AFNetworking.h
      - UIImageView+AFNetworking.h
      - UIKit+AFNetworking.h
      - UIProgressView+AFNetworking.h
      - UIRefreshControl+AFNetworking.h
      - UIWebView+AFNetworking.h
    Build Configurations:
    - Debug:
        Build Settings:
          OTHER_LIBTOOLFLAGS: ''
          PRODUCT_NAME: $(TARGET_NAME)
          IPHONEOS_DEPLOYMENT_TARGET: '6.0'
          ARCHS: $(ARCHS_STANDARD_64_BIT)
          OTHER_LDFLAGS: ''
          MTL_ENABLE_DEBUG_INFO: 'YES'
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          GCC_PREFIX_HEADER: Target Support Files/AFNetworking/AFNetworking-prefix.pch
          ENABLE_STRICT_OBJC_MSGSEND: 'YES'
        Base Configuration: AFNetworking-Private.xcconfig
    - Release:
        Build Settings:
          OTHER_LIBTOOLFLAGS: ''
          PRODUCT_NAME: $(TARGET_NAME)
          IPHONEOS_DEPLOYMENT_TARGET: '6.0'
          ARCHS: $(ARCHS_STANDARD_64_BIT)
          OTHER_LDFLAGS: ''
          MTL_ENABLE_DEBUG_INFO: 'NO'
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          GCC_PREFIX_HEADER: Target Support Files/AFNetworking/AFNetworking-prefix.pch
          ENABLE_STRICT_OBJC_MSGSEND: 'YES'
        Base Configuration: AFNetworking-Private.xcconfig
